script: |
  super -f tsv -I q9833.sql | sort > q9833.out

vector: true

inputs:
  - name: q9833.sql
    data: |
      SELECT DISTINCT - 87 AS col0 FROM tab0 WHERE col2 NOT IN ( col1 * col2 - + 79 + - - col0 * + - col2, col1 / - col0, - ( - 75 ) - ( - col0 ) );
  - name: tab0

outputs:
  - name: q9833.out
    data: |
      -87
